export function Job() {
    const { id } = useParams()

    const [job, setJob] = useState(currentJob)
    const getJob = () => {
        axios.get('https://capstone-be.herokuapp.com/api/jobs').then((res) => {
            console.log(res.data)
            setJob(res.data)
        })
    }

useEffect(() => {
    getJob()
}, [])

    return (
        <>
            {job.map((job) => {
                return (
                    <div className='jobs' key={'job.id'}>
                        <h4>{job.id}</h4>
                        <h4>{job.title}</h4>
                        <h5>{job.company}</h5>
                     </div>
                )
            })}
        </>
    )
}
